//[MiscUserCode] You can add your own definitions of your custom methods or any other code here...
void ParameterStructDisplay::sliderValueChanged(Slider* slider)
{
	if (slider == (Slider*)this)
	{
		if (m_paramStructTypePtr != nullptr)
		{
			m_paramStructTypePtr->setValue((uint8)getValue(), Parameter::GuiWidget);
		}
	}
}

// parameter changes of groovebox memory block
void ParameterStructDisplay::changeListenerCallback(ChangeBroadcaster *source)
{
	if (Parameter* param = dynamic_cast<Parameter*>(source))
	{
		// if one of the parameters changed
		if (param == m_paramStructTypePtr && (uint8)getValue() != m_paramStructTypePtr->getValue())
		{
			setValue(m_paramStructTypePtr->getValue(), dontSendNotification);
		}
		else if (param == m_param1Or3OnPtr || param == m_param2Or4OnPtr) 
		{
			if (m_param1Or3OnPtr->getValue() == 1 && m_param2Or4OnPtr->getValue() == 1) setEnabled(true);
			else setEnabled(false);
		}
		repaint();
	}
}

